import styled from "styled-components";

const Album = styled.ul`
  display: flex;
  flex-direction: column;
  overflow: scroll;
  justify-content: center;
  align-items: center;
  width: 100vw;
  height: calc(300vh-36rem);
`;

const Photo = styled.li`
  display: flex;
  justify-content: center;
  align-items: center;
  list-style: none;
  height: calc(100vh-12rem);
  overflow: hidden;
  object-fit: contain;
`;

const IMG = styled.div`
  width: 100%;
  height: 100%;
  background-color: aqua;
`;

function MainIMGs() {
  return (
    <Album>
      <Photo>
        <IMG>사진1</IMG>
      </Photo>
      <Photo>
        <IMG>사진2</IMG>
      </Photo>
      <Photo>
        <IMG>사진3</IMG>
      </Photo>
    </Album>
  );
}

export default MainIMGs;
